			<div class="stl_view">
				<div class="stl_05 stl_06">
					<div class="stl_01" style="left:15.4484em;top:5.8959em;"><span class="stl_07 stl_08 stl_09" style="word-spacing:-0.0001em;">Conditions générales d'utilisation &nbsp;</span></div>
					<div class="stl_01" style="left:20.0503em;top:9.3063em;"><span class="stl_10 stl_11 stl_12" style="word-spacing:0.009em;">En vigueur au 02/11/2022 &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:12.8568em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0008em;">Les présentes conditions générales d'utilisation (dites « </span><span class="stl_14 stl_11 stl_15" style="word-spacing:-0.0006em;">CGU </span><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0005em;">») ont pour objet l'encadrement juridique &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:14.0403em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">des modalités de mise à disposition du site et des services par PMJ</span><span class="stl_10 stl_11 stl_16" style="word-spacing:0.2783em;">&nbsp;</span><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0004em;">et de définir les conditions &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:15.2238em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0006em;">d’accès et d’utilisation des services par « </span><span class="stl_14 stl_11 stl_16" style="word-spacing:-0.0005em;">l'Utilisateur </span><span class="stl_10 stl_11 stl_17">». &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:16.4073em;"><span class="stl_10 stl_11 stl_18" style="word-spacing:0.0002em;">Les présentes CGU sont accessibles sur le site à la rubrique «</span><span class="stl_14 stl_11 stl_16">CGU</span><span class="stl_10 stl_11 stl_16">». &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:18.7743em;"><span class="stl_10 stl_11 stl_19">T</span><span class="stl_10 stl_11 stl_20">o</span><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0002em;">ute inscription ou utilisation du site implique l'acceptation sans aucune réserve ni restriction des &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:19.9577em;"><span class="stl_10 stl_11 stl_21" style="word-spacing:0.0017em;">présentes CGU par l’utilisateur. Lors de l'inscription sur le site via le Formulaire d’inscription, chaque &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:21.1412em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">utilisateur accepte expressément les présentes CGU en cochant la case précédant le texte suivant : &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:22.3247em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">« Je reconnais avoir lu et compris les CGU et je les accepte ». &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:23.5082em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">En cas de non-acceptation des CGU stipulées dans le présent contrat, l'Utilisateur se doit de renoncer &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:24.6917em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">à l'accès des services proposés par le site. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:25.8752em;"><span class="stl_10 stl_11 stl_12" style="word-spacing:0.287em;">planmyjourney.com se</span><span class="stl_10 stl_11 stl_16" style="word-spacing:0.0045em;">&nbsp;</span><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0004em;">réserve le droit de modifier unilatéralement et à tout moment le contenu des &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:27.0587em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">présentes CGU. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:29.9974em;"><span class="stl_07 stl_08 stl_16" style="word-spacing:0em;">Article 1 : Les mentions légales &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:33.4078em;"><span class="stl_10 stl_11 stl_22" style="word-spacing:0.0025em;">L'édition du site planmyjourney.com est assurée par la Société Startup PMJ au capital de 1 euros, &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:34.5913em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">immatriculée au RCS de _______________ sous le numéro _______________, dont le siège social &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:35.7748em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">est situé au 1 rue de la technologie &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:36.9583em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">Numéro de téléphone 0669696969 &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:38.1418em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">Adresse e-mail : planmyjourney@supporrt.com. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:39.3252em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:-0.0019em;">Le Directeur de la publication est : Thierry Henri &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:41.6922em;"><span class="stl_10 stl_11 stl_23" style="word-spacing:0.0005em;">L'hébergeur du site planmyjourney.com est la société AWS, dont le siège social est situé au 1 rue de &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:42.8757em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0004em;">Amazon, avec le numéro de téléphone : 0612345678. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:45.8145em;"><span class="stl_07 stl_08 stl_13" style="word-spacing:-0.0071em;">ARTICLE 2 : Accès au site &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:49.2249em;"><span class="stl_10 stl_11 stl_24" style="word-spacing:0.0076em;">Le site planmyjourney.com</span><span class="stl_10 stl_11 stl_16" style="word-spacing:0.2819em;">&nbsp;</span><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">permet à l'Utilisateur un accès gratuit aux services suivants : &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:50.4083em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">Le site internet propose les services suivants : &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:51.5918em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0002em;">création de parcours touristique &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:52.7753em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:-0.0008em;">Le site est accessible gratuitement en tout lieu à tout Utilisateur ayant un accès à Internet. </span><span class="stl_10 stl_11 stl_19">T</span><span class="stl_10 stl_11 stl_20">o</span><span class="stl_10 stl_11 stl_20" style="word-spacing:0.0005em;">us les &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:53.9588em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">frais supportés par l'Utilisateur pour accéder au service (matériel informatique, logiciels, connexion &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:55.1423em;"><span class="stl_10 stl_11 stl_18" style="word-spacing:0.0002em;">Internet, etc.) sont à sa charge. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:57.5093em;"><span class="stl_10 stl_11 stl_25" style="word-spacing:0.002em;">L’Utilisateur non membre n'a pas accès aux services réservés. Pour cela, il doit s’inscrire en &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:58.6928em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">remplissant le formulaire. En acceptant de s’inscrire aux services réservés, l’Utilisateur membre &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:59.8762em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0004em;">s’engage à fournir des informations sincères et exactes concernant son état civil et ses coordonnées, &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:61.0597em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">notamment son adresse email. &nbsp;</span></div>
					<div class="stl_01" style="left:43.2157em;top:65.1022em;"><span class="stl_10 stl_11 stl_16">1</span></div>
				</div>
			</div>
		</div>
		<div class="stl_ stl_02">
			<div class="stl_03">
				<img src="data:image/png;base64," alt="" class="stl_04" />
			</div>
			<div class="stl_view">
				<div class="stl_05 stl_06">
					<div class="stl_01" style="left:5.9042em;top:5.8626em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">Pour accéder aux services, l’Utilisateur doit ensuite s'identifier à l'aide de son identifiant et de son mot &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:7.0461em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">de passe qui lui seront communiqués après son inscription. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:8.2296em;"><span class="stl_10 stl_11 stl_19">T</span><span class="stl_10 stl_11 stl_20">o</span><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">ut Utilisateur membre régulièrement inscrit pourra également solliciter sa désinscription en se &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:9.413em;"><span class="stl_10 stl_11 stl_17" style="word-spacing:0.0008em;">rendant à la page dédiée sur son espace personnel. Celle-ci sera effective dans un délai raisonnable. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:10.5965em;"><span class="stl_10 stl_11 stl_19">T</span><span class="stl_10 stl_11 stl_20">o</span><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">ut événement dû à un cas de force majeure ayant pour conséquence un dysfonctionnement du site &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:11.78em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">ou serveur et sous réserve de toute interruption ou modification en cas de maintenance, n'engage pas &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:12.9635em;"><span class="stl_10 stl_11 stl_26" style="word-spacing:0.0023em;">la responsabilité de planmyjourney.com. Dans ces cas, l’Utilisateur accepte ainsi ne pas tenir rigueur &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:14.147em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0002em;">à l’éditeur de toute interruption ou suspension de service, même sans préavis. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:15.3305em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0002em;">L'Utilisateur a la possibilité de contacter le site par messagerie électronique à l’adresse email de &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:16.514em;"><span class="stl_10 stl_11 stl_21" style="word-spacing:0.0016em;">l’éditeur communiqué à l’ARTICLE 1. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:19.4527em;"><span class="stl_07 stl_08 stl_16" style="word-spacing:0em;">ARTICLE 3 : Collecte des données &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:22.8631em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">Le site assure à l'Utilisateur une collecte et un traitement d'informations personnelles dans le respect &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:24.0466em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">de la vie privée conformément à la loi n°78-17 du 6 janvier 1978 relative à l'informatique, aux fichiers &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:25.2301em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:-0.0025em;">et aux libertés. Le site est déclaré à la CNIL sous le numéro _______________. &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:26.4136em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">En vertu de la loi Informatique et Libertés, en date du 6 janvier 1978, l'Utilisateur dispose d'un droit &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:27.5971em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">d'accès, de rectification, de suppression et d'opposition de ses données personnelles. L'Utilisateur &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:28.7806em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0003em;">exerce ce droit : &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:29.964em;"><span class="stl_27 stl_11 stl_16">·</span></div>
					<div class="stl_01" style="left:8.2667em;top:29.964em;"><span class="stl_10 stl_11 stl_18" style="word-spacing:0.0001em;">par mail à l'adresse email planmyjourney@support.com &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:32.9028em;"><span class="stl_07 stl_08 stl_16" style="word-spacing:0.0001em;">ARTICLE 4 : Propriété intellectuelle &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:36.3132em;"><span class="stl_10 stl_11 stl_13" style="word-spacing:0.0004em;">Les marques, logos, signes ainsi que tous les contenus du site (textes, images, son…) font l'objet &nbsp;</span></div>
					<div class="stl_01" style="left:5.9042em;top:37.4967em;"><span class="stl_10 stl_11 stl_21" style="word-spacing:0.0018em;">d'une protection par le Code de la propriété intellectuelle et plus particulièrement par le droit d'auteur. &nbsp;</span></div>
